

CREATE TABLE `app_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `app_name` varchar(50) NOT NULL,
  `type_payment` varchar(100) NOT NULL,
  `address` varchar(100) NOT NULL,
  `contact_number` varchar(100) NOT NULL,
  `app_company_name` varchar(100) NOT NULL,
  `maximum_items_displayed` float NOT NULL,
  `logo` text NOT NULL,
  `accounting_period` int(11) NOT NULL,
  `statementID` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_cart` (
  `cartID` bigint(20) NOT NULL AUTO_INCREMENT,
  `itemID` int(255) NOT NULL,
  `quantity` double NOT NULL,
  `costprice` double NOT NULL,
  `price` double NOT NULL,
  `accountID` int(11) NOT NULL,
  `Customer` varchar(100) NOT NULL,
  `date_due` int(11) NOT NULL,
  `customerID` int(255) NOT NULL,
  `comments` text NOT NULL,
  `type_price` varchar(100) NOT NULL,
  `terms` float NOT NULL,
  `ts_orderID` bigint(20) NOT NULL,
  `salesmanID` int(11) NOT NULL,
  `discount` double NOT NULL,
  `own_use` int(11) NOT NULL,
  PRIMARY KEY (`cartID`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_cart_expenses` (
  `cartID` int(255) NOT NULL AUTO_INCREMENT,
  `description` varchar(150) NOT NULL,
  `expenses` double NOT NULL,
  `accountID` int(255) NOT NULL,
  `comments` text NOT NULL,
  `x3` int(11) NOT NULL,
  PRIMARY KEY (`cartID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_cart_receiving` (
  `cartID` int(255) NOT NULL AUTO_INCREMENT,
  `itemID` int(255) NOT NULL,
  `quantity` float NOT NULL,
  `accountID` int(255) NOT NULL,
  `supplierID` int(255) NOT NULL,
  `mode` varchar(50) NOT NULL,
  `costprice` double NOT NULL,
  `subtotal` double NOT NULL,
  `comments` text NOT NULL,
  `date` int(11) NOT NULL,
  `terms` int(11) NOT NULL,
  `invoice_number` varchar(200) NOT NULL,
  `freight` double NOT NULL,
  `type` varchar(50) NOT NULL,
  PRIMARY KEY (`cartID`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_credits` (
  `creditID` int(255) NOT NULL AUTO_INCREMENT,
  `accountID` int(255) NOT NULL,
  `customerID` int(255) NOT NULL,
  `amount` double NOT NULL,
  `date` varchar(50) NOT NULL,
  `payment` double NOT NULL,
  `paymentID` varchar(255) NOT NULL,
  `type_payment` varchar(150) NOT NULL,
  `comments` text NOT NULL,
  PRIMARY KEY (`creditID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_customer` (
  `customerID` int(255) NOT NULL AUTO_INCREMENT,
  `companyname` varchar(50) NOT NULL,
  `address` varchar(50) NOT NULL,
  `email` varchar(50) NOT NULL,
  `phone` varchar(50) NOT NULL,
  `contactperson` varchar(50) NOT NULL,
  `deleted` int(11) NOT NULL,
  `tin_id` varchar(200) NOT NULL,
  `credit_limit` double NOT NULL,
  `term` int(11) NOT NULL,
  PRIMARY KEY (`customerID`)
) ENGINE=InnoDB AUTO_INCREMENT=328 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_expenses` (
  `expensesID` int(255) NOT NULL AUTO_INCREMENT,
  `category` varchar(50) NOT NULL,
  `expense_account` text NOT NULL,
  `description` text NOT NULL,
  `amount` double NOT NULL,
  `comments` text NOT NULL,
  `accountID` int(255) NOT NULL,
  `deleted` int(11) NOT NULL,
  `date` int(11) NOT NULL,
  `terms` int(11) NOT NULL,
  `payee` text NOT NULL,
  `fully_paid` int(11) NOT NULL,
  `date_payment` int(11) NOT NULL,
  `comment_payment` text NOT NULL,
  `date_due` int(11) NOT NULL,
  `deleted_by` int(11) NOT NULL,
  `deleted_comment` text NOT NULL,
  PRIMARY KEY (`expensesID`)
) ENGINE=InnoDB AUTO_INCREMENT=1330 DEFAULT CHARSET=utf8;


