CREATE TABLE `tbl_expenses_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(20) NOT NULL,
  `expense_account` text NOT NULL,
  `description` text NOT NULL,
  `amount` double NOT NULL,
  `deleted` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=361 DEFAULT CHARSET=latin1;






CREATE TABLE `tbl_income_statement` (
  `statementID` int(255) NOT NULL AUTO_INCREMENT,
  `complete` int(11) NOT NULL,
  `beginning_inventory_items` text COLLATE utf8_unicode_ci NOT NULL,
  `beginning_inventory_value` text COLLATE utf8_unicode_ci NOT NULL,
  `beginning_date` int(11) NOT NULL,
  `beginning_time` int(11) NOT NULL,
  `beginning_by` int(11) NOT NULL,
  `closing_inventory_items` text COLLATE utf8_unicode_ci NOT NULL,
  `closing_inventory_value` text COLLATE utf8_unicode_ci NOT NULL,
  `closing_date` int(11) NOT NULL,
  `closing_time` int(11) NOT NULL,
  `closing_by` int(11) NOT NULL,
  `receiving_items` text COLLATE utf8_unicode_ci NOT NULL,
  `receiving_value` text COLLATE utf8_unicode_ci NOT NULL,
  `freight` double NOT NULL,
  `selling_expenses_items` text COLLATE utf8_unicode_ci NOT NULL,
  `selling_expenses_value` text COLLATE utf8_unicode_ci NOT NULL,
  `admin_expenses_items` text COLLATE utf8_unicode_ci NOT NULL,
  `admin_expenses_value` text COLLATE utf8_unicode_ci NOT NULL,
  `capital_expenses_items` text COLLATE utf8_unicode_ci NOT NULL,
  `capital_expenses_value` text COLLATE utf8_unicode_ci NOT NULL,
  `sales` double NOT NULL,
  `sales_returns_discount` double NOT NULL,
  PRIMARY KEY (`statementID`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;






CREATE TABLE `tbl_items` (
  `itemID` int(255) NOT NULL AUTO_INCREMENT,
  `itemname` varchar(100) NOT NULL,
  `category` varchar(50) NOT NULL,
  `sub_costprice` double NOT NULL,
  `srp` double NOT NULL,
  `supplierID` int(11) NOT NULL,
  `quantity` float NOT NULL,
  `costprice` double NOT NULL,
  `deleted` int(11) NOT NULL,
  `reorder` int(11) NOT NULL,
  `item_code` varchar(200) NOT NULL,
  `std_price_to_trade_terms` double NOT NULL,
  `std_price_to_trade_cod` double NOT NULL,
  `price_to_distributors` double NOT NULL,
  `unit_of_measure` varchar(100) NOT NULL,
  PRIMARY KEY (`itemID`)
) ENGINE=InnoDB AUTO_INCREMENT=4435 DEFAULT CHARSET=utf8;






CREATE TABLE `tbl_orders` (
